class Solution:
    def tictactoe(self, moves: List[List[int]]) -> str:
        qipan = [[-1 for _ in range(3)] for _ in range(3)]
        if len(moves) < 5:
            return "Pending"
        player = 0
        for mov in moves[:4]:
            qipan[mov[0]][mov[1]] = player
            player = 1 if player == 0 else 0

        for mov in moves[4:]:
            qipan[mov[0]][mov[1]] = player
            for row in qipan:
                if row[0] > -1 and row[0] == row[1] == row[2]:
                    return 'A' if player == 0 else 'B'
            for c in range(3):
                if qipan[0][c] > -1 and qipan[0][c] == qipan[1][c] == qipan[2][c]:
                    return 'A' if player == 0 else 'B'
            if qipan[0][0] > -1 and qipan[0][0] == qipan[1][1] == qipan[2][2]:
                return 'A' if player == 0 else 'B'
            if qipan[0][2] > -1 and qipan[0][2] == qipan[1][1] == qipan[2][0]:
                return 'A' if player == 0 else 'B'

            player = 1 if player == 0 else 0

        return 'Draw' if len(moves) == 9 else 'Pending'

    def numOfBurgers(self, tomatoSlices: int, cheeseSlices: int) -> List[int]:
        if tomatoSlices % 2 == 1:
            return []
        a = tomatoSlices // 2 - cheeseSlices
        b = 2 * cheeseSlices - tomatoSlices // 2
        if a >= 0 and b >= 0:
            return [a, b]
        else:
            return []

    def countSquares(self, matrix: List[List[int]]) -> int:
        w, h = len(matrix[0]), len(matrix)
        min_side = min(w, h)
        sum_map = [[0 for _ in range(w)] for _ in range(h)]
        sum_map[0][0] = matrix[0][0]
        for i in range(1, w):
            sum_map[0][i] = sum_map[0][i-1] + matrix[0][i]
        for j in range(1, h):
            sum_map[j][0] = sum_map[j-1][0] + matrix[j][0]
        for i in range(1, w):
            for j in range(1, h):
                sum_map[j][i] = sum_map[j-1][i] + sum_map[j][i-1] - sum_map[j-1][i-1] + matrix[j][i]

        total = sum_map[-1][-1]
        for window_size in range(2,min_side+1):
            bt = total
            for i in range(w - window_size + 1):
                for j in range(h - window_size + 1):
                    if j == 0:
                        upper = 0
                    else:
                        upper = sum_map[j-1][i+window_size-1]
                    if i == 0:
                        left = 0
                    else:
                        left = sum_map[j+window_size-1][i-1]
                    if i == 0 or j == 0:
                        lt = 0
                    else:
                        lt = sum_map[j-1][i-1]

                    if sum_map[j+window_size-1][i+window_size-1] - upper - left + lt == window_size ** 2:
                        total += 1
            if bt == total:
                break

        return total


    def palindromePartition(self, s: str, k: int) -> int:
        n = len(s)
        cost = [[0] * n for _ in range(n)]
        for span in range(2, n+1):
            for i in range(n - span +1 ):
                j = i + span - 1
                cost[i][j] = cost[i+1][j-1] + (0 if (s[i] == s[j]) else 1)

        dp = [[0]*n for _ in range(k)]
        dp[0] = cost[0]
        for kk in range(1,k):
            for nn in range(kk,n):
                dp[kk][nn] = 10**9
                for r in range(nn):
                    dp[kk][nn] = min(dp[kk][nn], dp[kk-1][r] + cost[r+1][nn])
        return dp[-1][-1]




